import classes from "./MealItems.module.css";

function MealItem(props){
    return(<li className={classes}>
            <div>
                <h3>{props.name}</h3>
                <div className={classes.description}>
                {props.discription}
                </div>
                <div className={classes.price}>
                {props.price}
                </div>
            </div>
        </li>
    )
}

export default MealItem;
